大容量でコンパクト！給湯ボタンが大きくて押しやすい<img src="http://image.rakuten.co.jp/cocodecow/cabinet/zaikocall.gif" width="303" height="100" border="0"><br />●容量：５．０Ｌ●サイズ：幅２２９×奥行３０３×高さ３２１ｍｍ●重量：２．７ｋｇ●湯沸し時消費電力：９０５Ｗ●保温時平均消費電力（９０度）：４５Ｗ●保温温度：７０度／９０度／９８度●色：アーバンベージュ●電源コード長さ：約１．２ｍ●保証期間：１年<BR><BR><BR><BR><BR><BR>タイガー魔法瓶　ＴＩＧＥＲ　たいがー　マイコンデンドウポット　まいこんでんどうぽっと　タイガー魔法瓶　電動ポット　電気ポット　電気ケトル　魔法ビン　まほうびん　ＰＤＮ－Ａ５００ＣＵ　ＰＤＮＡ５００ＣＵ　５．０Ｌ　キッチン家電　生活家電　キッチン家電　ケトル、電動ポット　大（４Ｌ以上）電動ポット<style type="text/css">
