■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>たっぷりお湯が使えて便利!「大容量5L」タイプ。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0380/5064ar-01.jpg" width="600" height="960"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【商品ポイント】<br>・断熱材使用の「省エネ設計」<br>・残量が少なくなるとお知らせ「給水お知らせブザー」<br>・水量がとっても見やすい 「パノラマウインドウ」+「赤玉水量計」<br>・気になる蒸気を約90％カットする「蒸気セーブモード」(選択式)(蒸気セーブモードと通常沸とう時との比較)<br>・カップめんなどに便利!「3分タイマー」<br><br>機能/5段階節約タイマー(6、7、8、9、10時間)、3段階保温温度設定(98度、90度、80度)、4つの設計(空だき防止、傾斜湯もれ防止、転倒湯もれ防止、自動給油ロック)、カフェドリップ給湯、クエン酸洗浄コース(3秒押し)、カルキとばし沸とう、お知らせメロディー、広口容器</font></td></tr></table><br><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">省エネ性が向上した大容量5Lタイプの電動ポットです。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">省エネ性が向上した大容量5Lタイプの電動ポットです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">23×30×33cm</font><br><font color="#333333" size="-1">個装サイズ：29×29×36cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">3kg</font><br><font color="#333333" size="-1">個装重量：3600g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">カラー</font></td><td align="left"><font color="#333333" size="-1">グレー</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">本体：ポリプロピレン</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">消費電力：985W(湯沸かし時)<br>電源コード：1.2m<br>容量：5.0L</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書、保証書(保証期間1年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
