■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>高級感漂うデザインと使いやすいシンプル機能♪</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5357/1035140-01.jpg" width="457" height="501"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【特長】<br>●空だき防止<br>内容器に水がない空だき状態を検知したら、ヒーターへの通電を自動的に切ります。<br><br>●マグネット式プラグ<br>万一コードを引っかけても、すぐにはずれて安心です。<br><br>●上ぶた着脱式<br>上ぶたがはずせて中せんもないシンプル構造ですので、給水・お手入れがラクです。<br><br>●カルキとばし<br>沸とう時間を自動的に延長して、気になる水道水のカルキ臭を蒸気とともにとばして、おいしいお湯をつくります。<br><br>●再沸とう<br>ボタンを押せば、保温中のお湯が再沸とうします。<br><br>●コードレス給湯<br>電源なしで給湯できます。プラグを抜くと時間の経過とともに冷めていきます。<br><br>●360度回転<br>クルリと360度回転するので、お手元で給湯できます。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">ボタン一つで再沸とう。印刷鋼板ボディでキレイで丈夫な電気ポットです。軽く大きな、押しやすいプッシュプレートで給湯もラクラク。凸凹の少ない、ステンレス製のフラットな内容器でお手入れもカンタンです。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ボタン一つで再沸とう。印刷鋼板ボディでキレイで丈夫な電気ポットです。軽く大きな、押しやすいプッシュプレートで給湯もラクラク。凸凹の少ない、ステンレス製のフラットな内容器でお手入れもカンタンです。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">W195×D256×H340mm</font><br><font color="#333333" size="-1">個装サイズ：20×26×34cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約1.9kg</font><br><font color="#333333" size="-1">個装重量：2000g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">内容器:ステンレス鋼<br>胴部:プリント鋼鈑</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">容量:3.0L<br>消費電力:湯沸かし650W<br>電圧:100V<br>電源コード長さ:1.4m</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">取扱説明書、保証書(保証期間1年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
